import './App.css';
import "crypto";

function App() {
	let divs = [];

	for (let i = 0; i < 10; i++)
		divs.push(<div
			key={Math.random().toString(36)}
			>Hello { i }!
			</div>);

	return (
		divs
	);
}

export default App;
